  QueryBuilder<Product, Product, QDistinct> distinctByFavorite() {
    return QueryBuilder.apply(this, (query) {
      return query.addDistinctBy(r'favorite');
    });
  }

  QueryBuilder<Product, Product, QDistinct> distinctByFavoriteTime() {
    return QueryBuilder.apply(this, (query) {
      return query.addDistinctBy(r'favoriteTime');
    });
  }

  QueryBuilder<Product, Product, QDistinct> distinctByFiyat() {
    return QueryBuilder.apply(this, (query) {
      return query.addDistinctBy(r'fiyat');
    });
  }

  QueryBuilder<Product, Product, QDistinct> distinctByModel(
      {bool caseSensitive = true}) {
    return QueryBuilder.apply(this, (query) {
      return query.addDistinctBy(r'model', caseSensitive: caseSensitive);
    });
  }

  QueryBuilder<Product, Product, QDistinct> distinctByTags() {
    return QueryBuilder.apply(this, (query) {
      return query.addDistinctBy(r'tags');
    });
  }
}

extension ProductQueryProperty
    on QueryBuilder<Product, Product, QQueryProperty> {
  QueryBuilder<Product, int, QQueryOperations> idProperty() {
    return QueryBuilder.apply(this, (query) {
      return query.addPropertyName(r'id');
    });
  }

  QueryBuilder<Product, bool, QQueryOperations> favoriteProperty() {
    return QueryBuilder.apply(this, (query) {
      return query.addPropertyName(r'favorite');
    });
  }

  QueryBuilder<Product, DateTime?, QQueryOperations> favoriteTimeProperty() {
    return QueryBuilder.apply(this, (query) {
      return query.addPropertyName(r'favoriteTime');
    });
  }

  QueryBuilder<Product, double?, QQueryOperations> fiyatProperty() {
    return QueryBuilder.apply(this, (query) {
      return query.addPropertyName(r'fiyat');
    });
  }

  QueryBuilder<Product, String?, QQueryOperations> modelProperty() {
    return QueryBuilder.apply(this, (query) {
      return query.addPropertyName(r'model');
    });
  }

  QueryBuilder<Product, List<String>, QQueryOperations> tagsProperty() {
    return QueryBuilder.apply(this, (query) {
      return query.addPropertyName(r'tags');
    });
  }
}
